// NewTaskCard.js
import React from 'react';
import './NewTaskCard.css';

const NewTaskCard = ({ onBackToMainCard }) => {
  return (
    <div className="new-task-card">
      <h2>New Task</h2>
      <button className="action-button" onClick={onBackToMainCard}>
        Back to Main Card
      </button>
    </div>
  );
};

export default NewTaskCard;
